import {
  TableContainer,
  TableBody,
  TableCell,
  TableRow,
  Paper,
} from '@mui/material';

export const Main = () => (
  <TableContainer component={Paper}>
    <TableBody>
      <TableRow>
        <TableCell />
        <TableCell />
        <TableCell />
      </TableRow>
    </TableBody>
  </TableContainer>
);
